import React from 'react';
import '../styles/Intern.css';

function Intern() {
  return (
    <div className="intern">
      <label>What to join as a inter in my company?</label>
      <input type="text" placeholder="Enter your details here... (Name: , Contact: @ig || @linkedin || @github...)" />
      <button type="submit">Sumit</button>
    </div>
  );
}

export default Intern;
